        if (this.serie_lote_form) {
            this.srv.valida_serie_articulo(datos).subscribe(function (data) {
                console.log("OBTENIENDO DATOS DE SERIE ARTICULO");
                console.log(data);
                if (data['numfac_org'] != 'NO EXISTE') {
                    _this.disponible_lote = data['disponible'];
                    _this.fecha_cad_form = data['feccad'];
                }
                else {
                    alert("Serie a descargar no registrada en el sistema");
                    _this.serie_lote_form = undefined;
                    _this.disponible_lote = undefined;
                    _this.fecha_cad_form = undefined;
                    _this.cantidad_form = undefined;
                }
            });
        }
