    AdminListaPedidosComponent.prototype.correo_pedido = function (numtra, nomcli, email) {
        var _this = this;
        var confirm_pedido = confirm('Usted va a reenviar correo del pedido a su cliente, está seguro de reenviar?');
        if (confirm_pedido) {
            console.log("CORREO FACTURACION");
            console.log(numtra);
            console.log(nomcli);
            console.log(email);
            // alert("Por favor ingrese RUC del cliente");
            if (email) {
                var datos = {};
                datos['codemp'] = this.empresa;
                datos['usuario'] = this.usuario;
                datos['nomcli'] = nomcli;
                datos['num_ped'] = numtra;
                datos['asunto'] = 'pedido';
                datos['email'] = email;
                this.espera_correo_pedido = true;
                this.espera_exitoso_pedido = false;
                this.error_envio_correo = false;
                this.srv.mail(datos).subscribe(function (data) {
                    console.log(data);
                    if (data['status'] == 'ENV') {
                        _this.espera_correo_pedido = false;
                        _this.espera_exitoso_pedido = true;
                        console.log(data);
                        window.scrollTo(0, 0);
                    }
                    if (data['status'] == 'NENV') {
                        _this.espera_correo_pedido = false;
                        _this.error_envio_correo = true;
                        _this.descripcion_error = data['descripcion'];
                        window.scrollTo(0, 0);
                    }
                }, function (error) {
                    _this.espera_correo_pedido = false;
                    _this.error_envio_correo = true;
                    window.scrollTo(0, 0);
                });
            }
            else {
                alert("Correo del cliente a enviar no disponible. Favor modificar agregar correo en la ficha del cliente.");
            }
        }
        else {
            console.log("NO ENVIO NADA");
        }
    }; //FIN ENVIO CORREO PEDIDO
