    AdminPosComponent.prototype.cargar_encabezado_pedido = function (numtra, tiptra) {
        var _this = this;
        console.log("########### CARGAR ENCABEZADO PEDIDO ################### ");
        // console.log ("########### "+numtra+" ################### ")
        // console.log ("########### "+tiptra+" ################### ")
        var datos = {};
        datos['codemp'] = this.empresa;
        datos['usuario'] = this.usuario;
        datos['pedido'] = numtra;
        datos['tiptra'] = tiptra;
        datos['consulta_renglon'] = 1;
        console.log(datos);
        this.numtra_pedido = numtra;
        this.tiptra_pedido = tiptra;
        this.srv.get_encabezado_pedido(datos).subscribe(function (data) {
            console.log("##### OBTENIENDO ENCABEZADO PEDIDO A FACTURA  ######");
            console.log(data);
            if (data['email'] == null) {
                data['email'] = 'NN';
            }
            _this.select_razon_social(data['tpIdCliente'], data['identificacion'], data['cliente'], data['email'], data['codcli'], data['direccion']);
            //FORMAS DE PAGO
            // public check_efectivo = false
            // public check_cheque = false
            // public check_tarjeta = false
            // public check_credito = false
            // public check_trasf_dep = false
            _this.iva_cant_new = data['iva_cantidad'];
            _this.total = data['total_pedido'];
            _this.desc_cant = data['descuento'];
            if (data['descuento_pctje'] === null) {
                _this.desc_porcentaje = 0;
            }
            else {
                _this.desc_porcentaje = data['descuento_pctje'];
            }
            _this.subtotal = data['totnet'] - data['descuento'];
            _this.total_neto = data['totnet'];
            // this.fectra = data['fecfac']
            // this.totalBaseIva = data['totbas']
            // console.log ("##### TOTAL BASE ####")
            // console.log (data['totbas'])
        });
        this.srv.get_renglones_pedido(datos).subscribe(function (data) {
            console.log("##### OBTENIENDO RENGLONES ####");
            console.log(data);
            // this.elements_checkedList = data
            // this.inserta_pedido()
            _this.articulos_pedido = data;
            _this.subtotal = _this.articulos_pedido.reduce(function (acc, obj) { return acc + (obj.subtotal_art); }, 0);
            _this.iva_cant = (_this.subtotal * _this.iva_porcentaje) / 100;
            _this.iva_cant_new = _this.articulos_pedido.reduce(function (acc, obj) { return acc + (obj.precio_iva); }, 0);
            setTimeout(function () {
                _this.desc_cant = _this.redondear(_this.articulos_pedido.reduce(function (acc, obj) { return acc + (obj.v_desc_art); }, 0));
                _this.total_neto = _this.subtotal + _this.desc_cant;
            }, 500);
            _this.total = (_this.subtotal - _this.desc_cant) + _this.iva_cant_new;
            var lista_base_iva = _this.articulos_pedido.filter(function (e) { return e['codiva'] == 'S'; });
            var subtotalBaseIva = lista_base_iva.reduce(function (acc, obj) { return acc + (obj.subtotal_art); }, 0);
            var descBaseIva = lista_base_iva.reduce(function (acc, obj) { return acc + (obj.v_desc_art); }, 0);
            _this.totalBaseIva = _this.redondear(subtotalBaseIva + descBaseIva);
            console.log("########### TOTAL BASE CON IVA ###########");
            console.log(lista_base_iva);
            console.log(_this.totalBaseIva);
            console.log(_this.desc_cant);
            _this.desc_porcentaje = _this.redondear(_this.desc_cant * 100 / _this.total_neto);
            //pedido
            // campos = ['codart','nomart','coduni','codiva','cantid','preuni','poriva','cant_iva','totren','desren','num_docs','des_cant','numren']
            //get_renglones_pdv
            // campos = ['index','codart','nomart','coduni','cant','prec01','totren','punreo','codiva','poriva','precio_iva','v_desc_art','subtotal_art']
        });
    };
