    AdminPosComponent.prototype._filter = function (value) {
        console.log(this.options);
        console.log("filtro 1");
        return this.options.map(function (x) { return x.nomcli; }).filter(function (option) { return option.toLowerCase().includes(value.toLowerCase()); });
    };
    AdminPosComponent.prototype._filter2 = function (value) {
        console.log("filtro 2");
        return this.articulo.map(function (y) { return y.nomart; }).filter(function (option) { return option.toLowerCase().includes(value.toLowerCase()); });
    };
